// 路由配置文件

import Vue from 'vue'
import VueRouter from 'vue-router'
import connect from './components/connect'
Vue.use(VueRouter)

const router = new VueRouter({
 routes:[
    {
        path:'/connect',
        component:connect
      },
    {
        path: '/',
        redirect: '/connect'
    }
 ]
})

export default router
